            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>Inside Holy Trinity Cemetery on the southeast corner of Mt Olive. camouflaged pill bottle size cache in the back of the cemetery amongst the trees. Be respectful of the cemetery surroundings. She has her back to you.\u00a0\u00a0 There are weeds and it can be muddy. The cemetery hours are dawn to dusk, do not search at night. This is not a 24/7 cache hunt. Do not hunt for this cache after dark. Across town from Rt 66 and Mother Jones sites.\u00a0 BYOP</p>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>Inside \u00a0Holy Trinity Catholic Cemetery on the southeast corner of Mt Olive. \u00a0This small/medium sized cache is in the back of the cemetery amongst the trees. There is no need to disturb any one. She has her back to you. There will be weeds nearby and it can be muddy. \u00a0Although it is not far from Rt 66 sites it is on the other side of town from Mother Jones. There is a beautiful monument here, beautiful surroundings. <strong>The cemetery is open from dawn until dusk, which is the only time the cache is available. Do not search for the cache after dark. This is not a 24/7 hunt. Please do not attempt this cache at night.</strong> <strong>Please respect those residing here.</strong></p>\n<p><strong>HOLY TRINITY CEMETERY \u00a0\u00a0</strong> <strong>Macoupin County\u00a0\u00a0\u00a0</strong> <strong>Southeast Corner of the City of Mt. Olive, IL</strong><br />\n<strong>\u00a0\u00a0\u00a0 The Holy Trinity Cemetery is a Catholic Cemetery and is under the direction of the Holy Trinity Slovak Church.\u00a0 This church was founded in 2012. This cemetery is not very old for it wasn\u2019t until the Slovak congregation decided to build their church that they also decided to have a cemetery of their own in which to bury the deceased members of their parish.\u00a0 This cemetery was first laid out in 1914.</strong><br />\n\u00a0\u00a0\u00a0<br />\n<strong>In August, 1914 the Holy Trinity Parish bought land southeast of the church about 3 blocks away, for cemetery purposes.\u00a0 The deed conveying the title to the land over to the church reads as follows:\u00a0 THIS INDENTURE WITNESSETH THAT THE GRANTORS: Brunke J. Schoen and Elenora Schoen, his wife, of the town of Mt. Olive, in the County and State of Illinois for and in consideration of $900.00 in hand paid, CONVEY and WARRANT to Holy Trinity Slovak Church, of the Village of Mount Olive, County of Macoupin, State of Illinois the following described real-estate, to-wit:\u00a0\u00a0 (Here is given a long legal description that a researcher can find in the WPA Holy Trinity Cemetery file at Macoupin County Archives, Carlinville, IL).</strong><br />\n<strong>This deed is dated August 5, 1914 and was recorded in the office of the Recorder of Deeds for Macoupin County, Illinois in Volume 264 of Miscellaneous Records, at page 420.)\u00a0 Recorded August 5, 1914.</strong><br />\n\u00a0\u00a0\u00a0<br />\n<strong>\u00a0\u00a0\u00a0 The Holy Trinity Cemetery is in good condition and is taken care of by the relatives of the dead and other members of the parish.\u00a0 The ground is level and dry.\u00a0 There is a cinder surfaced drive leading to the center of the cemetery.\u00a0 The occupied lots are on the two tiers on either side of the driveway.\u00a0 At the end of the driveway, which runs only to the center, is a concrete alter with a large wooden cross which is expected to be improved so that field masses can b e held yearly.\u00a0 There are 102 graves in this cemetery at the present time.\u00a0 The grass is kept cut and the owners of the lots keep their individual lots very neat.\u00a0 This cemetery is enclosed with a woven-wire fence on the south and west, a hedge is along the east and a wooden fence on the north which is the entrance.\u00a0 At the entrance is a wooden gate and an arch with the name of the cemetery printed on it.</strong><br />\n<br />\n<strong>\u00a0\u00a0\u00a0 The Holy Trinity Cemetery is located in the most southeast corner of the city of Mount Olive.\u00a0 It can be easily reached at all times as there is a good road leading to it.</strong></p>\n<p><strong>\u00a0\u00a0\u00a0 The oldest grave in the Holy Trinity Cemetery is that of Anthony Lepinski, who died on October 14, 1914. There are 102 graves.</strong><br />\n<br />\n<strong>\u00a0\u00a0\u00a0 In this cemetery is one of the most beautiful monuments that one will find in any cemetery.\u00a0 It is the monument erected on the lot of Reverend Knaperack.\u00a0 This lot is located at the center of the cemetery to the right of the Alter.\u00a0 The monument is made of Italian granite and marble and towers about 12 feet high.\u00a0 The base is made of granite about 5 \u00bd feet high upon which stands the life size figure of the Sacred Heart embracing a cross expertly cut.\u00a0 The evergreen trees which surround this lot give it a beautiful appearance.</strong></p>\n<p><strong>\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 Holy Trinity Church closed and the congregation merged with Ascension Catholic in 2011. It was renamed St. John Paul II in 2014. That merged church now is in charge of the cemetery.</strong></p>\n<p>\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0</p>\n<p>\u00a0</p>\n<p>\u00a0</p>"
            }, 
