            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>Check out the Old Water Tower. It is a magnetic small cache with only a log. Look high and low. Best searched for only in daylight hours. Poor street lighting.\u00a0 There is off street parking nearby. Be careful, don't get charged.</p>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>This is home grown water--the leg says so. Mt Olive got city water soon into the 20th century. I think this is the same tower, The wind makes strange ghost-like noises blowing through the bars--so the neighbors tell me. Mt Olive is a 150 year old town originally comprised of Slavic coal miners and German farmers. That culture is still present.</p>\n<p>Not far away from Rt 66 sites and Mother Jones. Enjoy those historic points, enjoy small town culture.</p>\n<p>Best searched only during daylight hours. Poor lighting. It is a magnetic cache with only log. Please bring your own writing instrument. There is off street parking.</p>"
            }, 
