                    "#text": "N 39\u00b0 11.192  W 89\u00b0 35.719\nNifty Placement! \u2013 After thrashing around some very uneven terrain at GZ and a bit beyond for about 45 minutes I then decided to approach this one as a puzzle cache - Eventually found the neat little container 0.11 miles (580 feet) from indicated GZ and of course the description and hint made perfect sense - Always fun to find a blank log sheet - Definitely earned my smiley on this one! \u2013 SL \u2013 Traded an Item \u2013 Thanks Jade.Eryn for placing this cache and making me put my thinking cap on!"
