            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>This is the first cache I have ever hidden, and I only have a few finds under my belt. Criticism and advice is more than welcome, but please be constructive. And be detailed in your adventure; I am planning to hide quite a few more, so, as I said, please share your knowledge with me. You can park in the street, right along the sidewalk, in front of the buildings.</p>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>You are looking for a relatively small, plastic container that's wrapped with camouflage duct tape. Also has lime green hinges holding it shut. Help yourself to the stuff inside, but please trade. The owner of Cocoa Blue has already granted me permission to hide this cache, so don't worry about that. After saying that, I believe it is necessary to say that this cache is NOT meant to advertise. I just thought this would be a good place to hide this cache. Please tell me immediately if anything is wrong, and, again, any advice is welcome.\u00a0</p>"
            }, 
