                    "#text": "i had to take my sis who is here to springfield this rainy morning to meet up with her husband's family. why not stop and get a couple of the new caches in the area on my way. the last time i was here, this one was mia. thanks for replacing it. i got out right at gz, and made the quick find. the cache is in good shape.  thanks odd intentions for the hide, and the smiley for me."
