                    "#text": "Geocaching with Mean Gene and The Rooter on another route to Springfield, IL, this time with steady rain for more than half of the day. We logged caches as \"MG/TR/RO\" to be brief. No luck on this one today... in the pouring rain. Thanks, The 0ld Goat, for placing this cache! -- roelsch, Saint Charles, MO."
