                    "#text": "CORRECTED Ferris Bueller's Day Off (1986)\n\nN 39 45.1AB\nW 89 33.2CD\n\nA = the third number in the year of the car divided by two\nB = how many friends skipped school with the star\nC = the third number of the year the movie was released\nD = how many sisters the star has in the movie\n\nN 39 45.142 W 89 33.281\n\n1961 Ferrari California GT\n2 friends, Cameron & Sloane"
