            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>I'm used to placing one cache out at a time, but I had three ready to go so I figured I'd release them all at the same time.  I also tried to spread their locations out to even out the chances for FTF-seekers.</p>\n\n<p>Don't get intimidated when you get to GZ.  There's lots of hidding spots, but this cache is a good five feet off the ground.  The log is very small.  Just write your initials and feel free to replace the log as needed.</p>"
            }, 
