            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>This is a camoflauged traditional geocache hidden in one of Springfield's most prestigious parks. The park is only open certain hours so please read the signs as you are entering. As with all parks in Springfield this park closes at 9:30 P.M. so please limit your search during open hours.</p>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>The cache is located on a hillside a little off the trail which can be a little slippery when the ground is wet so please watch your footing if so. The cache can be spotted easily when you get close. Please replace the cache as you found it so the next geocacher can make the find. The cache is only big enough for a log sheet so make sure to bring a writing utensil to sign as found.\u00a0</p>\n<p>This cache owner:<br />\n- Maintains thier own caches. Please advise if there is a problem.<br />\n- Appreciates logs that are not cut and pasted :) Be creative<br />\n- As always PLEASE be careful out there<br />\n<br />\nGood luck and Happy hunting.</p>\nCongrats to pzzldmom on her first FTF!!!!"
            }, 
