            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<h3><b>This cache celebrates my 1,000 find!</b></h3>\nI got this idea from a challenge cache in Southern Illinois. \u00a0The cache IS at the posted coordinates, BUT,\u00a0you need caches identified as 1 through 16 of a series in the cache name."
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "You can sign the log before getting all 16, but you cannot log the find until you meet the requirements!<br />\nCaches with numbers in the name, \u201cThree Strikes and You're Out\u201d, do not count. \u00a0You cannot break apart numbers. \u00a0If you find \"Illinois Challenge 112\", it does not count as a #2 or a #12; it is a 112.\u00a0<br />\nSeries caches using Roman numerals or the word form of the number can be used. Finally, you can only use one cache from each series. If you have all of the \"History Lesson\" series #1-#50, you can only use one from the series. You can put your caches in a bookmark list or post them on the web page like this:<br />\nGC3KAVC - Country Roads #1 - mrtwain56<br />\nGC374KT - Bar Hoppin #2 - drmc10<br />\nGC1ENPT - Where's Wall-ee #3 - monkeyboy00<br />\nGC30QMP - Gateway to Eternity #4 - Top of the Hill - BlackJeep1989 etc..."
            }, 
            "groundspeak:encoded_hints": "Look for your high numbers first, the #1-4 are easy to find", 
