                    "#text": "FTF  11/18/13  3:30 pm or so.  Came back with the sun up and made the find rather quickly.  I have the cords off by 50ft to 75ft.  The name of this cache and the hint should be enough to make the grab.  Tell your daughter I took bead 11 and placed in a cache that I have in my front yard.  Privet Drive (GC3M4ED) Where it goes from there---Nobody knows.  Thanks Melicobb for this cache and FTF#115 for me.  Hope to see some more caches from you.\n\nOri"
