            "groundspeak:country": "United States", 
            "groundspeak:state": "Illinois", 
            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>This series will take you to all the places I love to hate!</p>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>Ori's Revenge #1 ------ Bleachers</p>\n<p style=\"margin-left:40px;\">\u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0Pulling up to a nice park with fresh cut grass gives me a warm, fuzzy feeling when I am out geocaching. \u00a0But the feelings soon changes to dread when my GPS is making a bee line to some bleachers. \u00a0I hate bleacher hides. \u00a0I know one of two things are going to happen now. \u00a01. I will be able to spot a magnetic key box from the underbelly of the bleachers... or 2. \u00a0I will have to run my hands down every inch of this thing to make the grab...and sometimes that doesn't even work. \u00a0Well my friends, Bleachers is not a typical hide....Many curveballs have been seen from these bleachers, but now your up to bat. \u00a0This geocache follows all the rules and can\u00a0be found at a reasonable distance from GZ.</p>\n<p>\u00a0</p>\n<p>The Ori's Revenge series was placed in the Springfield area to highlight my LEAST favorite type of locations to hunt for a cache. \u00a0Why do you ask would I put out such a nasty series. \u00a0Well first of all, Springfield has already got plenty of P&amp;Gs and family friendly caches to choose from. \u00a0But I will have to say revenge is the main reason these are placed. \u00a0I have spent too many hours at locations like these. \u00a0Now it's my turn. \u00a0I will NOT be giving out ANY hints for these until it is found. \u00a0Even after the cache has been found, to get a hint, you must first log a DNF. Those are the rules. \u00a0Please respect all rules and laws of parks and parking when hunting. This series isn't for everyone... I personally would bring a pen and tweezers for these caches. \u00a0If you can't find it, that doesn't mean a \"requires maintence\" or \"needs archived\" should to be logged. \u00a0This series of caches is for the Geocacher who loves a challenge and the feeling of victory from a tough find....So if your ideal caching is a day filled with lamppost skirt lifting and going from telephone pole to telephone pole...You may not want to do these. \u00a0BUT MOST OF YOU WILL! \u00a0ENJOY or just ignore...LOL</p>\n<p>\u00a0</p>\n<p>\u00a0</p>\n<p>\u00a0</p>\n<p>\u00a0</p>\n<p>\u00a0</p>\n<p>\u00a0</p>\n<p>\u00a0</p>"
            }, 
            "groundspeak:encoded_hints": "You will find bleachers in, on or close to bleachers.  You will be looking for a container of some sort.  Inside the container will be a log for you to sign.", 
