                    "@encoded": "False", 
                    "#text": "kenny and i headed out bright and early this morning to hit a cool numbers series, and anything along the way. kenny parked right next to gz, and he had to make the grab. (being short stinks). the cache is in great shape, and is 1 of many on the day for me. thanks razor1965 for the hide, and the smiley for me. now off for a little lunch before heading back out."
