                  "groundspeak:type": "Found it", 
                  "groundspeak:finder": {
                    "@id": "1294643", 
                    "#text": "claystalker"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "Out and about chasing down a few caches for the day. I had plans to hit the bike trails on my new fat tire bike but since it was raining I stuck to the 4 wheels and wandered all over the country side. Last of the day. Thanks for the series. TFTCSL"
                  }
