            "groundspeak:short_description": {
              "@html": "False", 
              "#text": "This is between a nano and a micro.\nMapRat and I got up early this morning to walk in the 5th Annual Walk A Mile In Her Shoes.  If you have never heard about this you can go to this site to read more.  http://www.firstgiving.com/pcasa"
            }, 
            "groundspeak:long_description": {
              "@html": "False", 
              "#text": "While I was out with MapRat hiding a military series of German Heavy Tank Battalions of WWII we came across these two roads.  Taylor Homestead and Bunn. \nOur last names are Taylor and the team we walked with was Bunn.  I decided to place a hide here to honor all the men who walked in their high heel shoes to raise money for PCASA.  I've walked in heels for a long time, but I am sure it was not easy for many of the men who did walk a real mile in high heel shoes.  So I tip my heels to all of you who walked."
            }, 
