            "groundspeak:long_description": {
              "@html": "False", 
              "#text": "Out with MapRat hiding a military series of German Heavy Tank Battalions of WWII. MapRat was a tanker in the US Army and he has a strong knowledge of tanks. This is just one of the roads we were on while out scoping the area for him. I just happened to see a spot I liked so I hid one here.   Once again I saw a bridge.  What more can I say!\n\nCongrats to all of the FTF team.  It's great to know that after a full year of sitting on a bridge that someone thought outside the box and found it."
            }, 
