                  "groundspeak:type": "Found it", 
                  "groundspeak:finder": {
                    "@id": "1889199", 
                    "#text": "TNcachersRus"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "We are in town for my birthday to visit my brother and his family, they are our caching buddies, HinckleyQuest, Sat. we found 33 caches, Sun. we found 8 and today we found 40.  I was the driver for the day today, so when we got to this cache it was the last one of the day, I was reading the logs while the other 3 got out of the car, we had a gps and 2 phones, all 3 said it was in one place, so as I walk up, those 3 are hanging over the bridge, laying on the road saying it should be right here, I said we need to think outside the box, so I walked away from them and walked right to it, simple for me, I always look outside the box, my husband tends to get focused on what the gps says, but like many other times our coords were off.  Thanks it was fun to be the first to find for both of our teams, and even more fun knowing the cache had been there a year and no one had found it yet.   Thanks for making my birthday weekend a blast!!!"
                  }
