                  "groundspeak:finder": {
                    "@id": "0", 
                    "#text": "GSAK"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "Rho: \"Roman Though\": B=5\nAlpha: \"MINERVA CLEAVED\" D=6\nTheta: \"OFFICIALLY DOMINION\" G=5\nBeta: \"reigning actually\" H=8\nXi: \"swallow vanquished\" A=4\nOmicron: \"Persephone perpetual\" E=6\nPi: \"mountain sinews\" F=4\nGamma: \"Aphrodite Trojan\" None\n\nN39 AB.CDE W89 FG.HIJ\nN39 45.C66 W89 45.8IJ\n\nC=0,1 most likely\n\nN39 45.060 W89 45.800 start here and go northwest... to Centennial Park!"
                  }
